import React, {useEffect} from "react";
import "./index.css";
import AppContext from "../../context";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import TwittersView from "../TwittersView/TwittersView";
import ArticlesView from "../ArticlesView/ArticlesView";
import NotesView from "../NotesView/NotesView";
import Header from "../../components/Header/Header";
import Modal from "../../components/Modal/Modal";

import draftGraphic from "../../draft.png";
import wallGraphic from "../../wall.png";
import DecorationArrow from "../../components/DecorationComponents/DecorationArrow/DecorationArrow"
import ImagePort from "../../components/ImagePort/ImagePort"
import Logo from "../../components/Logo/Logo"
import img1A from "../../Photos/A1.jpg"
import img1B from "../../Photos/A2.jpg"
import img2A from "../../Photos/B2.jpg"
import img2B from "../../Photos/B1.jpg"
import img3A from "../../Photos/C1.jpg"
import img3B from "../../Photos/C2.jpg"
import beforeWorkGraphic from "../../draft.png"
import afterWorkGraphic from "../../wall.png"
import downArrowGraphic from "../../down-arrow.png"

import Aos from 'aos'
import "aos/dist/aos.css";

class Root extends React.Component {
  state = {
    twitter: [],
    article: [],
    note: [],
    isModalOpen: false
  };



  addItem = (e, newItem) => {
    e.preventDefault();

    this.setState(prevState => ({
      [newItem.type]: [...prevState[newItem.type], newItem]
    }));

    this.closeModal();
  };

  openModal = () => {
    this.setState({
      isModalOpen: true
    });
  };

  closeModal = () => {
    this.setState({
      isModalOpen: false
    });
  };

  ZobaczWiecejClicked = () => {
    // this.setState({
    //   isModalOpen: false
    // });
    alert("clikc");
  };
  // useEffect(() => {
  //   Aos.init({duration:2000});
  // }, []) ;

  render() {

    let noBullets = {
      listStyleType : "none"
    };

    Aos.init({duration:2000});
    const { isModalOpen } = this.state;
    const contextElements = {
      ...this.state,
      addItem: this.addItem
    };

    return (
      // <BrowserRouter>
      //   <AppContext.Provider value={contextElements}>
      //     <Header openModalFn={this.openModal} />
      //     <Switch>
      //       <Route exact path="/" component={TwittersView} />
      //       <Route path="/articles" component={ArticlesView} />
      //       <Route path="/notes" component={NotesView} />
      //     </Switch>
      //     { isModalOpen && <Modal closeModalFn={this.closeModal} /> }
      //   </AppContext.Provider>
      // </BrowserRouter>

      <div id="website">
        <div id="logo"><Logo /></div>
        <div id="nav">
          <div id="navItem">O nas |</div>
          <div id="navItem">&nbsp;Oferta |</div>
          <div id="navItem">&nbsp;Portfolio |</div>
          <div id="navItem">&nbsp;Kontakt</div>
        </div>
        <div id="whatWeDo">
          <h4 >#Zostań w domu, remont zostaw nam.</h4>
          <h4>O nas</h4>
          <div id="SectionContent">
          InterBuild – to firma remontowo-wykończeniowa, działająca na rynku polskim już ponad 10 lat.
Przez ten cały czas zapracowaliśmy sobie na zaufanie wielu klientów z całej Polski.
Stawiamy przede wszystkim na skrupulatne zabezpieczenie powierzchni przed wykonaniem usługi jak i wysoką jakość stosowanych produktów, przez co precyzja i poziom wykonania usług zadowoli najbardziej wymagających klientów.
Jesteśmy Autoryzowanymi Wykonawcami firmy Greinplast, z którą ściśle współpracujemy.
Do każdego Klienta podchodzimy indywidualnie, oferujemy profesjonalne doradztwo, pomiar oraz darmową wycenę.
Współpracujemy z wieloma projektantami wnętrz jak i z architektami, przez co nasze prace zawsze są dopięte do najmniejszych szczegółów.

          </div>
        </div>
        <div id="offer">
          <h4>Oferta</h4>

          <div id="SectionContent">
          Oferujemy kompleksowe wykończenia wnętrz, od stanu deweloperskiego, aż po sam klucz.
Specjalizujemy się w układaniu płytek typu monolit, wielkoformatowe jak i kamień naturalny.
Dodatkowo wszelkiego rodzaju tynki dekoracyjne takie jak: beton, cegła, tapety 3D, stiuki itp. Zakres usług:
<br></br><br></br>
      <div className="SectionContent_Columns">
      <div className="SectionContent_Columns_Column">
      <b>Prace wykończeniowe:</b>
              <ul style={noBullets}>
                <li><i class="fa fa-paint-brush" aria-hidden="true"></i> malowanie ścian i sufitów</li>
                <li><i class="fa fa-paint-brush" aria-hidden="true"></i> tapetowanie</li>  
                <li><i class="fa fa-paint-brush" aria-hidden="true"></i> nakładanie gładzi szpachlowej</li>
                <li><i class="fa fa-paint-brush" aria-hidden="true"></i> układanie paneli podłogowych i ściennych</li>
              </ul>

              <b>Prace murarsko-tynkarskie:</b>
             <ul style={noBullets}>
                <li><i class="fa fa-wrench" aria-hidden="true"></i> wykonywanie ścianek działowych</li>
                <li><i class="fa fa-wrench" aria-hidden="true"></i> tynkowanie</li>
              </ul>  

              <b>Prace Glazurnicze:</b>
           <ul style={noBullets}>
                <li><i class="fa fa-wrench" aria-hidden="true"></i> układanie płytek, monolitów, gresu i terakoty</li>
                <li><i class="fa fa-wrench" aria-hidden="true"></i> kompleksowe remonty łazienek</li>
              </ul> 
      </div>
      <div className="SectionContent_Columns_Column">
      <b>Montaż płyt kartonowo-gipsowych:</b>
            <ul style={noBullets}>
                <li><i class="fa fa-check" aria-hidden="true"></i> wykonywanie podwieszanych sufitów</li>
                <li><i class="fa fa-check" aria-hidden="true"></i> wykonywanie ścian działowych</li>
                <li><i class="fa fa-check" aria-hidden="true"></i> wykonywanie różnego rodzaju zabudowy</li>
                <li><i class="fa fa-check" aria-hidden="true"></i> kwykonywanie półek</li>
              </ul>

              <b>Inne:</b>
           <ul style={noBullets}>
                <li><i class="fa fa-heart-o" aria-hidden="true"></i> przenoszenie punktów elektrycznych</li>
                <li><i class="fa fa-heart-o" aria-hidden="true"></i> przenoszenie punktów hydraulicznych</li>
                <li><i class="fa fa-heart-o" aria-hidden="true"></i> składanie mebli</li>
                <li><i class="fa fa-heart-o" aria-hidden="true"></i> montaż armatury łazienkowej</li>
              </ul>

      </div>  
      </div> 

          </div>
        </div>
        <div id="decorationArrowAnimation">

          <DecorationArrow src={downArrowGraphic} width={50} height={50} />
        </div>
        <div id="portfolio">
          <div id="sideBar"><b>100% satysfakcji</b></div>
          <div id="imgSection">
          <h4>Portfolio</h4>
          <div  data-aos="fade-left" id="beforeAfterImgs">
            <div class="compareImages" id="beforeImg">
                <ImagePort src={img3A}/>
                <div className="beforeImgGraphic">
                      <img className="draftGraphic" src={draftGraphic}/>
                  </div>
              </div> 
              <div class="compareImages" id="afterImg">
                <ImagePort src={img3B}/>
                <div className="afterImgGraphic">
                      <img className="wallGraphic" src={wallGraphic}/>
                  </div>
              </div>                
            </div>
            <div data-aos="fade-up" id="beforeAfterImgs">
              <div class="compareImages" id="beforeImg">
                <ImagePort src={img1A}/>
                  <div className="beforeImgGraphic">
                      <img className="draftGraphic" src={draftGraphic}/>
                  </div>
              </div>
              <div class="compareImages" id="afterImg">
                <ImagePort src={img1B}/>
                  <div className="afterImgGraphic">
                      <img className="wallGraphic" src={wallGraphic}/>
                  </div>
              </div>
            </div>
            <div data-aos="fade-down" id="beforeAfterImgs">
              <div class="compareImages" id="beforeImg">
                <ImagePort src={img2A}/>
                <div className="beforeImgGraphic">
                      <img className="draftGraphic" src={draftGraphic}/>
                  </div>
              </div>
              <div class="compareImages" id="afterImg">
                <ImagePort src={img2B}/>
                <div className="afterImgGraphic">
                      <img className="wallGraphic" src={wallGraphic}/>
                  </div>
              </div>
            </div>

            <div id="seeMore" onclick={this.ZobaczWiecejClicked}>
              Zobacz wiecej ->
            </div>
          </div>
        </div>


        <div id="contact">
          <h4>Kontakt</h4>
          <div id="SectionContent">

<h6>InterBuild Krzysztof Wojtysiak</h6>
<h6>Telefon: 884 706 234 / 605987121</h6>
<h6>E-mail: kw.interbuild@gmail.com</h6>
<h6>NIP: 829-174-44-64</h6>
          </div>
        </div>
        <div id="footer">Paweł Łabuz pawel.labuz10@gmail.com</div>
      </div>
    );
  }
}

export default Root;

